import Login from "./Login";

const Home = (props) => {
  const setUserdata = props.setUserdata;
  const userdata = props.userdata;

  function loggedGreeting() {
    const lGreet = (
      <div className="homePage">
        {userdata && <h1 className="Greeting">Welcome to Fitness Tracker! </h1>}
        {userdata && <h2 className="Log">Logged in as {userdata.username}</h2>}
      </div>
    );

    return lGreet;
  }
};
<div className="defaultHome">
  <h1>Welcome to Fitness Tracker! </h1>
  <h2>
    Feel Free to Browse around or {Login} {userdata.username}
  </h2>
</div>;

export default Home;
